export default function About() {
    function Summary() {
        return (
            <>
            As a child, I grew up very shy. I would hide away behind books and always look down, as to avoid any type of conversation from my peers. However, as I have gotten older and more comfertable with myself, I found the power in my voice and realized the importance of communication. I believe that we can use technology as a way of sharing our visions and truths to the world. Technology can be found in every corner and my goal is to bring the light of your vision into the hands of others who will support and inspire you.
            <h2>Summary</h2>
            I am a results-oriented web developer with a solid foundation in computer science and a proven track record of delivering clean, scalable, and innovative code. I am eager to leverage my technical expertise and creativity to drive impactful projects.
            <h2>Skills</h2>
            Tech: JavaScript, React, MongoDB, CSS, HTML, Python, SQL, R, Tableau<br/> 
            Productivity: Microsoft Office,  Slack, Asana, Google Workspace, Trello<br/> 
            Languages: Spanish (Fluent)
            <h2>Education</h2>
            University of California, Santa Cruz<br/> 
            B.S. Molecular, Cell, Development Biology<br/> 
            B.A. Latin American and Latino Studies
            </>
        )
    }

    return(
        <div className="about-me">
            <h1>About Me</h1>
            <p className="about-intro">My name is Viviana Alba and I am a specialized full stack developer with a knack for problem solving and an eye for design.</p>
            <Summary />
        </div>
    )
}
